import React from 'react'

const Navbar = () => {
  return (
    <div className='h-10 z-1 bg-transparent'>
      <nav className="flex items-center justify-between flex-wrap px-4 py-3">
        <a href="#" aria-label="Home">
            <img src="/images/logo.svg" alt="Logo" className="w-8 mt-2"/>
            </a>
            </nav>
    </div>
  )
}

export default Navbar
